		'Описание проекта': `<p>Группа компаний А-100 Девелопмент предложила нам модернизировать типовой проект детского сада. Мы не могли работать над планами, но зато могли разработать максимально интересное фасадное решение. Чтобы изменить монотонность однотипного длинного фасада, мы применили такой прием: разбили фасад на «маленькие амстердамские домики», таким образом подчеркнули идею «квартала у моря». В основе концепции было заложено черно-белое фасадное решение с идеей того, что внутри садик будет очень ярким и красочным.</p>`,
