		'Год реализации': 2018,
		'Описание проекта': `<p>В этом проекте мы разрабатывали дизайн фасадов. Перед нами стояла задача сделать необычный фасад, так как сам дом представляет собой обычную коробку, стоящую на фундаменте. При разработке концепции мы опирались на бриф заказчика и на его основе пришла идея сделать "парящий" фасад. Мы предложили сделать вентфасад от нижнего уровня окон до самой высокой отметки дома, добавили подсветку по нижнему краю. Получившиеся конструкции вынесли за пределы фасада, уровняв их с террасой. Под этой конструкцией мы поставили кашпо из кортена и посадили в них высокую траву. Если посмотреть на дом с боковых фасадов, то можно увидеть, как фасад "оторван" от земли, он, как бы, начинается выше. Завершающим элементом фасада мы сделали консоли над "парящими" фасадами, они так же "оторваны" от дома.</p>`,
