		info: {
			Студия: 'Zrobym architects',
			Архитекторы: 'Екатерина Рулинская, Алексей Кораблев',
			Расположение: 'г. Москва, Российская Федерация',
			Площадь: '63 м.кв.',
			Год: '2018'
		},
		Координаты: '55.649870, 37.497513',
		'Показывать на карте?': 'Да',
		'Год реализации': 2018,
		'Описание проекта': `<p>В апартаментах со свободной планировкой мы сделали гостиную, совмещенную с кухней, и большую спальню с гардеробной. Санузлы, по пожеланию клиента, раздельные.<br /> Дизайн делался для молодого мужчины, который не будет постоянно проживать в квартире. Основными предпочтениями клиента были функциональность, лаконичность, минимализм, отсутствие большого количества чёрного и ярких цветов. <br /> Вся квартира выдержана в коричнево-бело-серой гамме, которая подчеркивает стабильность, спокойствие, уют.<br /> Входная зона объединена одним цветом, образуя единый портал. Керамогранит, краска для реек, шкафа, двери и стены подобраны максимально близко к единому тону. Входную зону не хотелось лишать света, но и гостиная должна была быть не настолько открытой зоной. Вращающиеся на 360 градусов перегородки помогли решить сразу две проблемы. Они образуют как единую стену, так и при другом угле дают свету проникать во всё помещение. На обратной стороне приклеено зеркало, оно выполняет не только свое прямое назначение, но и визуально расширяет пространство.<br /> Идея спальни так же построена на разделении помещения на 2 зоны с помощью цветовых порталов: первая зона -для сна, уютная и тёплая; вторая - у окна - для отдыха и чтения, светлая и минималистичная. Рейки, средние по тональности, задают направление и объединяют 2 пространства между собой. А коричневый цвет, между тем, создаёт ощущение комфорта и расслабленности. <br /> При использовании довольно плотных тонов в нужных местах квартира остаётся светлой и уютной.</p>`,
