		'Описание проекта': `<p>Основной задачей при разработке этого проекта являлось создание яркого нетривиального интерьера, и соблюдение при этом баланса натуральных материалов с насыщенными яркими цветами. В планировочном решении необходимо было создать максимально возможное пространство кухни-гостиной, сохранив при этом необходимый набор помещений для комфортного проживания молодой семьи с двумя детьми. Было принято решение присоединить лоджию к гостиной для увеличения пространства и освещенности основного помещения. Так же были организованы две ванных комнаты, которые условно разделены на детскую и взрослую. Основным фоном в оформлении помещений выбран белый цвет стен в сочетании с дубовым паркетом и сплошной зашивкой стены в гостиной из шпона дуба. На фоне этого яркими акцентами выделяются предметы мебели и насыщенный ярко-синий кухонный остров, который задаёт тон всему помещению.</p>`,
