		'Год реализации': 2018,
		'Описание проекта': `<p>Проект BYALІNSKAGA APARTMENT разрабатывался для молодой пары. Для них было важно создать функциональное, комфортное и светлое пространство для жизни. Основным пожеланием являлось использование натуральных материалов, живых растений и текстиля. <br />Изначально в квартире было 3 основных помещения. Перед нами стояла задача - разделить помещения таким образом, чтобы появился отдельный кабинет, сохранив при этом визуальную эстетику и функционал. <br />В результате появилось объединённое пространство кухни-гостиной. Предусмотрены разнообразные сценарии света: светодиоды, подвесные и настенные светильники.<br />Для детской было важно создать такую организацию пространства, чтобы в будущем там мог жить не один ребенок. Поэтому вся мебель легкозаменяемая, а вся электрика выведена таким образом, чтобы всегда была возможна перестановка. <br />Каждый элемент интерьера имеет свою особенность. К примеру, деревянные настенные панели за счет естественности природных материалов, мягкости тонов создают естественный уют.</p>`,
