		PAGETITLE: 'ДИЗАЙН КВАРТИРЫ FRIEND APARTMENT I',
		'Папка с фото': 105,
		'Основное изображение': 'http://zrobym.by/images/projects/FRIEND APARTMENT I/превью.jpg',
		'Краткое описание': 'Дизайн квартиры',
		'Тип проекта': 'Интерьер',
		'Реализован?': 'Нет',
		info: {
			Студия: 'Zrobym architects',
			Архитекторы: 'Екатерина Рулинская, Андрусь Bezdar',
			Расположение: 'г. Москва, Российская Федерация',
			Площадь: '71,5 кв.м.',
			Год: '2018'
		},
		Координаты: '55.649362, 37.497773',
		'Показывать на карте?': 'Да',
		'Год реализации': 2018,
		'Описание проекта': `<p>Из квартиры со свободной планировкой мы сделали трехкомнатную. Изначально тут была большая лоджия, но убрав внутреннее остекление, удалось добавить еще около 15 кв.м. полезной площади. За счет этого также стало больше света. <br />Основное направление концепции помещения задали окна, которые располагаются по периметру. Они не доходят до пола, поэтому всю корпусную мебель решено было так же приподнять на 40 см и запустить подсветку под основанием. Это сделало светлую квартиру еще легче и свободнее. А глубокий синий цвет подчеркивает ее характер. Хозяин не будет пользоваться квартирой часто, поэтому мы смогли позволить себе сделать ее не столько функциональной, сколько оригинальной. <br />Кухня - часть общего пространства, так как она объединена с гостиной. Глубокий синий цвет, камень Dekton, стулья фабрики Gubi и светильники Faro Barcelona делают ее изысканной и дорогой. <br />Захотелось уйти от привычного и попробовать поработать с интересными текстурами дерева, в данной квартире это - шпон корня вяза на корпусной мебели в спальне и гостиной. <br />Спальни отличаются друг от друга атмосферой. Первая: выдержанная в синем цвете с акцентами в виде светильников от Gubi и кроватью Minotti. Вторая: легкая и наивная, с пастельными стенами и насыщенным морковным цветом шкафа и лаконичной кроватью MDF Italia. <br />Двери в спальни выполнены из белого матового стекла, которое позволяет свету проходить из одного помещение в другое. </p>`,
