		'Описание проекта': `<p>Проект квартиры 431 был разработан для молодого парня. Мы избавились от всех существующих перегородок и присоединили 2 лоджии. Таким образом, удалось создать большое пространство кухни-гостиной для времяпрепровождения в компании друзей, и в то же время обеспечить необходимый набор изолированных помещений для будущей молодой семьи. Для наиболее рационального использования пространства маленькая лоджия в соcтаве кухни-гостиной была превращена в удобный подиум-диван с местами хранения под ним, т.к конструктивная особенность здания не позволяла присоединить полностью этот объем. Стилистически интерьер довольно прост и лаконичен. Взятые за основу белый цвет и деревянная отделка - разбавлены яркими, но спокойными цветами и растениями, наличие которых удовлетворяет одному из главных пожеланий заказчика.</p>`,
