		'Описание проекта': `<p>Для клиента было важно создать комфортное и светлое пространство для жизни. Основным пожеланием являлось использование натуральных материалов, живых растений и текстиля.<br /> Изначально в квартире не было перегородок. И была поставлена задача разделить помещение таким образом, чтобы в нем сочетались визуальная эстетика и функционал. В результате появилось объединённое пространство гостиной/кухни/столовой. А прихожая отделяется перегородкой из живых растений. Этот приём позволяет сохранить количество естественного освещения, не перегружая пространство. Кабинет включает в себя функцию гостевой комнаты. И из него имеется выход на лоджию, которая является зоной отдыха.<br /> Клиенты - пара спортивная и имеет большое количество спортинвентаря. Поэтому для хранения были спроектированы две просторные гардеробные.<br /> Каждый элемент интерьера имеет свою особенность. К примеру, деревянные панно за счет естественности природных материалов, мягкости тонов и бархатистости отшлифованной деревянной поверхности создают естественный уют. Декор, плетение перегородки, текстиль - все эти элементы придают интерьеру свой особый характер.</p>`,
