		'Год реализации': 2018,
		'Описание проекта': `<p>Основная идея интерьера данной трехкомнатной квартиры - максимально сохранить атмосферу дома того времени, в которое он был построен. Паркет «елочка», ретро мотивы в форме мебели, декора, плитка Vives, напоминающая плитку в подъездах - все эти маркеры того времени заиграли по-новому в современной квартире. Гостиную с кухней объединили. Так образовалось светлое, просторное помещение. Окна здесь выходят на северную сторону, поэтому мы решили за счет ярких цветов кухни и мебели сделать комнату теплой и насыщенной. А разнообразные сценарии света: споты, подвесной светильник, подсветка кухни, бра позволят ей оставаться светлой. Санузел было решено оставить раздельным, но увеличить его площадь за счет коридора. Коридор, хоть и уменьшился по площади, но большое зеркальное панно визуально расширило пространство. Окраска стен выполнена в три цвета, нижний тон темнее из функциональных соображений. Стекло позволяет проникать естественному свету из гостиной в холл. Старая ниша для шкафа была преобразована в удобные места для сидения и систему хранения. Детской комнате было отведено больше места за счет площади спальни, но это не помешало спальне остаться максимально функциональной за счет единой системы: шкаф-кровать-стол. Для самой детской на первом месте была важность такой организации пространства, чтобы в будущем там мог жить не один ребенок. Поэтому вся мебель легко заменяемая, а вся электрика выведена таким образом, чтобы всегда была возможна перестановка.</p>`,
