		'Описание проекта': `<p>Интерьер STALIN INTERIOR разработан для семьи с двумя детьми. Квартира находится в "сталинке", что сразу указало на ее стилистику. Перед нами стояла задача спроектировать интерьер, в котором сочетались бы современные материалы и стилистика сталинской эпохи. В интерьере была радикальная перепланировка, хотя изначально планировалось перенести только 2 стены и возвести ещё одну. В итоге мы с клиентом пришли к тому, что нам надо снести все перегородки и возвести их заново. Таким образом, мы получили 2 полноценных санузла, появился небольшой кабинет, спальня, детская и кухня-гостиная. Интересной особенностью интерьера является перегородка, которая разделяет кухню и гостиную. Перегородка в открытом состоянии стыкуется со стеной за диваном, а в закрытом - открывает покрашенную в синий цвет стену.</p>`,
