		'Описание проекта': `<p>Проект квартиры MJK был разработан для молодой семьи с детьми. Изначально в квартире не было перегородок, благодаря чему мы смогли учесть все пожелания Заказчика. Таким образом, мы спроектировали квартиру, в которой есть большая гостиная, совмещенная с кухней, детская комната, 2 санузла, спальня с гардеробом и кладовая. Также мы объединили кухню и гостиную с небольшим балконом. Чтобы объединить это пространство, мы утеплили наружную часть помещения и установили раздвижные двери, которые ездят по наружной стене. В других помещениях: спальне, санузлах и детской комнате, было принято решение сделать двери с матовым стеклом, через которое проходит свет. Благодаря таким дверям, коридор получается освещенным. В проекте в основном используются простые материалы, такие как фанера, паркетная доска, керамогранит. Изюминкой гостиной являются шторы: они закрываются по всему периметру, что создает интересный эффект мягкости и уюта.</p>`,
