		'Год реализации': 2018,
		'Описание проекта': `<p>Заказчик пришел к нам, чтобы обновить интерьер частного дома недалеко от Минска (Беларусь). Основной задачей проекта было максимально разгрузить интерьер, добавить в него воздуха. Несмотря на то, что интерьер был достаточно свежим, он устарел морально. Хотелось чего-то нового, необычного, уютного. Сперва было решено перенести помещения кухни и столовой в новое, достраиваемое помещение, увеличив таким образом площадь общей комнаты. Тяжелая, громоздкая бетонная лестница была заменена на более легкую, изящную лестницу из металлического профиля, обшитого натуральным деревом. В качестве ограждения используются ненесущие ванты, пронизывающие дом на все три этажа. Основным отделочным материалом стало дерево: пол, фасады мебели, стены, а иногда даже потолок, везде мы старались применить дерево в том или ином виде. Наши архитекторы сыграли на контрасте теплого и холодного - холодный пол (плитка под бетон, паркетная доска в серых холодных тонах) используются рядом с теплым деревом на стенах и в мебели. Стены, выкрашенные в белый цвет, послужили фоном для наполнения интерьера. Минимальное наличие ярких деталей можно найти в декоре, предметах интерьера и мебели. <br />Так же в ходе строительства полностью было переделано благоустройство участка, забор и добавлены элементы в архитектуру дома. Строительство велось в очень сжатые сроки, так как был перерыв в 9 месяцев. Все основные работы были сделаны менее чем за полгода.</p>`,
