		Координаты: '53.942046, 27.460259',
		'Показывать на карте?': 'Да',
		'Год реализации': 2018,
		'Описание проекта': `<p>В этот комплекс входят: кофешоп, барбершоп, спа, шоурум одежды и тату-студия. <br />Многофункциональность требует четкого разделения помещения на зоны, которые отражают характерные процессы, происходящие в них. Очень важной задачей было осуществление концепции "Isntant money", так как это коммерческое пространство. Таким образом, было принято решение размещения кофешопа в зоне, максимально приближенной ко входу, кофейня сама по себе является осуществлением концепции получения моментального дохода, продажа кофе не требует большого количества времени, так проходящие мимо люди могут "заскочить" за кофе, не вмешиваясь в процессы, проходящие в глубине помещения. Основную зону занимает сам барбершоп, решенный в качестве "витрины". Это бокс, огражденный матовыми стеклянными перегородками на торцах, отделяя пространства, в которых подразумевается продолжительное пребывание людей, тем самым обеспечивая комфорт посетителям барбершопа. Продольная сторона бокса выполнена из прозрачных стеклянных перегородок, на противоположной стене расположены стеллажи, на которых представлены продукты барбершопа. В этой же части помещения располагается спа-комната. С целью создания атмосферы лофтового пространства, было принято решение сохранить большинство стен и потолок без отделки, с открытой системой коммуникаций. Часть потолка над боксом барбершопа выполнена в виде подвесного потолка из металлической сетки, большое количество света в барбершопе и стеклянные перегородки, отделяющие его пространство, создают ощущение светящегося "куба". Далее на подиуме располагается шоурум одежды и зона ожидания для посетителей бербершопа и тату-студии. Сама тату-студия отделена прозрачной стеклянной перегородкой, за ней располагаются яркие полотна, подсвеченные неоном, учитывая расположение помещения тату-студии, именно эта часть стала ярким цветовым пятном, которое бросается в глаза прямо со входа. В санитарном узле выделяющейся деталью является металлическая рама, проходящая по всему периметру помещения, разделяющая его на контрастные цвета и плавно переходящая в вешалку, в сочетании с металлическим сантехническим оборудованием это создает атмосферу брутального и современного заведения. Отличительными чертами этого проекта стали минималистичные металлические вешалки и бетонные скамейки. Во всем интерьере использовано много металла, стекла и бетона в сочетании с теплым деревом. Таким образом, мы создавали интерьер за счет элементов, приближенных к стилю брутализма, с минимальными затратами на отделку. </p>`,
