		'Показывать на карте?': 'Да',
		'Год реализации': 2018,
		'Описание проекта': `<p>Проект интерьера производственного помещения. Kitchen Coffee Roasters занимаются обжаркой кофе в Минске. Проект был сделан в 2017 году, в течение года мы занимались его реализацией. Осенью 2018 года интерьер был целиком готов. Помещение почти в 200 квадратных метров мы увеличили за счёт построения второго этажа, на нем команда Kitchen Coffee Roasters буде проводит учебные семинары.В условиях ограниченного бюджета надо было сделать ремонт почти двухсот квадратных метров с высотой потолка в семь метров, с учётом построения второго этажа. Исходя из этого, мы предложили разделить помещение на два уровня. Весь ремонт основного пространства был сделан до уровня трёх метров от пола, таким образом мы сэкономили бюджет на отделку стен и потолка. Таким образом мы создали контраст между старыми стенами производственного цеха и гладкими белыми стенами нового производства. Мы использовали наливной пол. Деталью, которая подчёркивает идею "прерывания" дизайна на уровни трёх метров, являются картины. На трёх картинах нарисованы доберманы - один холст стоит на полу, на нем собака в полный рост, на двух других головы собак находятся выше чем уровень трёх метров от пола, соответственно головы не попадают в композицию.</p>`,
