		PAGETITLE: 'ДИЗАЙН КАФЕ GREEN CUISINE',
		'Папка с фото': 124,
		'Основное изображение': 'http://zrobym.by/images/projects/GREEN CUISINE/превью!.jpg',
		'Краткое описание': '',
		'Тип проекта': 'Интерьер',
		'Реализован?': 'Да',
		info: {
			Студия: 'Zrobym architects',
			Архитекторы: 'Роман Мохаммад, Андрусь Bezdar',
			'Фото и видео': 'Александра Кононченко',
			'Нейминг, логотип и фирменный стиль': 'компания Fabula',
			Расположение: 'ул. Интернациональная 23, Минск, Беларусь',
			Площадь: '70 м.кв.',
			'Год проектирования': '2017',
			'Год реализации': '2017'
		},
		Координаты: '53.903833, 27.558705',
