		'Год реализации': 2017,
		'Описание проекта': `<p>Интерьер кафе GREEN CUISINE мы начинали делать еще тогда, когда название было «Счастье здесь». Совместно с брендинговым агентством «Fabula» мы занимались преображением этого кафе. <br /> Команда агентства «Fabula» занималась неймингом, логотипом, фирменным стилем. И разработала концепцию вегетарианского кафе с домашней атмосферой. Задачей для нас стало создать интерьер, в котором гости могли бы себя чувствовать, как в небольшом итальянском кафе с вековой историей, где каждая вещь говорила бы об исторических моментах этого заведения. Конечно, добиться такого эффекта в интерьере можно только за долгий период времени. И мы решили, что не стоит на стадии проекта специально старить дизайн, т.к. это было бы воспринято как декорации в театре. Исходя из концепции Fabula, мы предложили не переделывать интерьер с нуля, а подчеркнуть его особенности и создать основу для его дальнейшего развития. <br /> По сути в отделке практически ничего не поменялось. Штукатурка на стенах осталась той же, материал пола так же остался неизменным. Единственное, что мы решили поменять радикально, это второй «маленький» зал. Его мы видели, как уютное помещение, в котором хочется общаться по душам. Для этого мы выбрали не совсем стандартный путь: не стали добавлять подушек и тёплых оттенков в отделке. Мы решили поставить столы с ярко выраженной текстурой и фактурой, сделали диваны с темной велюровой обивкой, отделали стены и потолок в черную декоративную штукатурку. Мы не добивались ощущения новизны, но при этом и не старили ее специально. Декоративная штукатурка на стенах малого зала сделана как художественное произведение мастерами строительного клуба INSHI. Они с самого начала общения дали понять, что не просто наносят декоративную штукатурку на стену, а подходят к этому, как художник подходит к холсту. Мебель для кафе, в частности столы, несколько раз менялись в ходе проектирования, но в итоге после обсуждений и поисков мы с заказчиком пришли к выводу, что не обязательно специально ошкуривать, старить столы. Было решено, что мы изготовим эти столы как новые изделия, но на этапе производства выявим текстуру и фактуру поверхностей, а после просто покроем маслом или лаком. <br /> В итоге мы получили кафе, которое не поменялось в глазах гостей радикально, а улучшили дизайн и помогли раскрыться его атмосфере.</p>`,
