		'Описание проекта': `<p>Главная задача при разработке интерьера бара – создать пространство, попадая в которое, чувствуешь себя в экзотическом месте. Это интерьер, в котором посетитель может расслабиться, отдохнуть от суеты, забыть о заботах. Интерьер бара решен в полинезийском стиле, основная идея оформления сформирована на основе полинезийской мифологии, связана с образами «тики», бога Маке-маке – бога изобилия, который олицетворял природные силы и считался творцом человека. В интерьере использована природная цветовая гамма, сложные фактуры материалов, потертые, состаренные поверхности стен, мебели. Приглушенное освещение создает приятную атмосферу для отдыха. Предметы мебели, декора индивидуальны, созданы по нашим чертежам. Плетеные коконы с крупными светильниками являются акцентами интерьера. Зона бара насыщена элементами полинезийского стиля и мифологии: наскальные изображения бога Маке-Маке, противовес полинезийской лодки на стене, часть разрушенной лодки с мачтой и парусом. Интерьер санузла представляет собой оазис с каменными умывальниками и обилием зелени. Сквозь светящиеся панели просматриваются листья пальмы и обитатели полинезийских лесов.</p>`,
