		'Описание проекта': `<p>Проект ресторана Simple мы начали разрабатывать ровно год назад. Изначально мы влюбились в пространство: большие арочные окна, много воздуха и просматриваемых зон. Мы хотели придать больше души, изысканности и привлекательности проекту, поэтому использовали специально спроектированные светильники с вьющимися растениями, выполненные под заказ столы из различных пород древесины, диваны с большим количеством подушек, каркасы из меди, которые со временем обрастут зеленью. В дополнение к этому использовали большое количество растений и дерева. Сочетание этих материалов создает теплую и уютную атмосферу. В результате у нас получился минималистичный интерьер, соответствующий философии кухни ресторана.</p>`,
