		'Год реализации': 2018,
		'Описание проекта': `<p>Этот проект мы начали делать еще два с половиной года назад, в 2016 году. Изначально, концепция заведения была противоположной - это был черный брутальный лофт. По сути, на данный момент такой брутализм вряд ли бы кого-то удивил, все уже привыкли к такому подходу в создании интерьеров заведений. И когда через год к нам вернулся Влад Луневич (ресторатор), чтобы пересмотреть концепцию, мы были очень воодушевлены.<br />Спустя год наша команда начала переделывать проект. Мы смотрели на него совершенно иначе, чем год назад. Нужно было создать интерьер, который бы стал приятным фоном для гостей. Весь характер интерьера скромен, сдержан, при этом практически полностью наполнен кастомными решениями. Вся мебель без исключения была изготовлена на заказ. Гипсовые панели в зале и тамбуре туалета тоже были изготовлены на заказ. Со светильниками вышла небольшая история, по проекту мы предполагали другой основной свет в зале. По некоторым причинам, нам нужно было предложить другой вариант на момент реализации. Поэтому мы предложили взяли торшер IKEA и подвесить его. Плитка на полу фабрики VIVES, ее мы предлагали сразу с несколькими другими вариантами напольного покрытия. К счастью была выбрана именно плитка.</p>`,
