		'Описание проекта': `<p>Дизайн квартиры на ул. Богдановича имеет символическое название, т.к. NK – первые буквы имен наших заказчиков – Надежды и Константина. Важная особенность проекта заключалась в нетипичной для нас работе над не совсем скандинавским дизайном квартиры. Заказчикам северная аскетичность и минимализм были не очень по душе, поэтому мы старались привнести в оформление пространства больше уюта, тепла и оригинальности.</p>
<p>В первую очередь, в глаза бросается обилие дерева, которое в этом интерьере мы использовали по максимуму: мебель, полы, перегородки, ящики для цветов и даже коврик в ванной выполнены из разных пород и оттенков дерева. Продолжением «деревянной темы» стали настоящие вязанки дров, расположенные возле биокамина. Иллюзия потрескивающих дров, создает в гостиной идеальную атмосферу для душевных разговоров и семейных вечеров. </p>
<p>Запоминающимся архитектурным решением в дизайне квартиры NK мы считаем огромную сдвижную перегородку (2 метра шириной), разделяющую спальную и гостиную зоны. Ее наличие позволяет при необходимости соединить (или, наоборот, отгородить) пространство столовой-гостиной и спальни друг от друга. В интерьере квартиры на Богдановича нашлось место не только оригинальным, но и просто забавным решениям. Например, в ванной комнате можно найти совершенно нетипичный атрибут: табличку офтальмолога. Станет скучно – можно и зрение проверить: почему нет?</p>`,
