		'Год реализации': 2014,
		'Описание проекта': `<p><strong>Удачное расположение.</strong> URBAN FLAT – это проект интерьера квартиры на проспекте Победителей. Нашим заказчикам повезло приобрести недвижимость в одном из самых живописных и молодых мест Минска – районе «Лебяжий». Из окна открывается вид на озеро и широкий шумящий проспект. Помимо URBAN FLAT в «Лебяжем» наша команда сейчас реализует еще 6 других проектов. </p>
<p><strong>Сочетание стилистики.</strong> В интерьере квартиры 120 м² мы хотели реализовать концепцию городской скандинавской квартиры. Яркие акценты в сочетании со спокойной – бежевой и серовато-кофейной – деревянной мебелью служили выполнению этой задачи. По максимуму в интерьер четырехкомнатной квартиры мы стремились вписать урбанистические мотивы. Как делается в большинстве современных лофтов, мы оставили часть стен и коммуникаций нетронутыми. Открытые трубы, стояки, кирпичные стены просматриваются по всему интерьеру. Это позволило нам частично реализовать в проекте URBAN FLAT индустриальный дизайн. </p>
<p><strong>Микс идей.</strong> Решение, которые мы впервые реализовали в дизайне квартиры URBAN FLAT – это переносной леттеринг. По всей квартире вы можете встретить объёмные буквы, которые вместе составляют слово URBAN. Еще одна идея, реализованная нами в урбанистическом пространстве квартиры – переход доски пола на стены. На высоте 900 см по периметру гостиной устраиваются скрытые места хранения. Отделкой их служит та же доска, что и на полу комнаты. С одной стороны, в получившемся «коробе» нам удалось спрятать коммуникации, с другой – там оборудованы удобные полки для хранения книг и вещей.</p>`,
