		'Описание проекта': `<p>Реконструкция детского садика.</p>
<p>Дети должны жить в мире красоты, игры, сказки, фантазии, творчества. Детский сад - это неотъемлемая часть жизни каждого ребенка. Поэтому в садике ребенку должно быть интересно и увлекательно. В экстерьере этого детского сада мы попытались максимально разработать не только сами фасады, но и площадку. Большой упор был сделан именно на игровую часть, чтобы малыши не только могли поиграть, но и развивать мышление и творчество. Даже сами фасады состоят из части игровой зоны: на стенах можно рисовать мелом, что безусловно понравится детям. Мы стремимся сделать их мир ярче, даже в детском саду. Хотим отметить, что это был уже существующее здание, которое заказалаи у нас для модернизации. А так как бюджет был минимальным, то мы использовали недорогие, но креативные материалы.</p>`,
